INSERT INTO `faqs` (`name`, `question`, `ip`, `sno`, `date`, `answer`, `status`) VALUES
('omega-3, p -1', 'will you please tell us when will you conduct the MEGA HEALTH CAMP ,sir?', '10.2.15.83', 154, '2013-02-25', 'we will intimate to you....', 1),
('SIVA KUMAR K-11', 'Sir what is the main aim of helping hands please explain this question sir ', '10.2.11.26', 155, '2013-02-27', 'Apart from education we can also respond and participate in social service of our society. ( but first preference is our students later basing on source money we will do out side charity)', 1),
('madhava', 'when will be the MEGA HEALTH CAMP is going to held?\r\n', '10.2.11.132', 156, '2013-03-01', 'Due to lack of time we decided to conduct health camp after this semester.', 1),
('M.Praveen', 'The puc students are not giving the money fullfilly', '10.2.20.73', 157, '2013-03-01', ' Its not a mandatory to give money to Helpinghands organization. Its their wish to donate or not. if we expose our activities, definitely they will contribute money to our Helpinghands organization.', 1),
('N120516', 'Respected sir, I want to become a batch representative. What shall I have to do?', '10.2.11.113', 158, '2013-03-02', 'As like every social organization Helping Hands also have rules & regulations so must follow the rules, no one is exception. Whenever we are going to change Batch representative we will intimate to you.', 1),
('puc-1', 'when will we get the volunteer''s list,sir?', '10.2.15.21', 160, '2013-03-04', 'Any way We updated executive members, representatives of Helpinghands organization. We got large member of list as volunteers for that we didn''t displayed. If it is possible we will displayed.You are requested to provide your name and class whenever you send FAQ.', 1),
('E2 Mech', 'I Want to know how much money is deposited in our helping hands account?????', '10.3.40.68', 161, '2013-03-04', 'Very soon we will update, any way ask your class Helping Hands representatives.You are requested to provide your name and class whenever you send FAQ.', 1),
('P1', 'Sir, you are collecting money as weekly. some of the students feels this like a burden.\r\nSo request you to change this process as "once" or "twice" a month.', '10.2.15.51', 162, '2013-03-05', 'Helping Hands committee decided that Collection of the money will be happen from the students every month on second Thursday But many members of representatives said that it is good collecting the money every week itself. so we change the process, that''s why now weekly collection is going on. anyway it''s not a mandatory to give every week, it their wish to contribute every week or not.You are requested to provide your name and class whenever you send FAQ.', 1),
('HR', 'Excuse me sir, In our class room our classmets asks me to give a speach about HELPING HANDS. I''m explained them what i know.I''m requestin you to arrange HR''s meeting once per every two months to suggest my friends. ', '10.2.15.51', 163, '2013-03-05', 'we will discuss about it in our Helpingahands executive committee. You are requested to provide your name and class whenever you send FAQ.', 1),
('p1', 'sir plese arrange the washerman for P.H.C why because phc''s  faced the lot of problems for washing clothes. plese sir ', '10.2.18.177', 164, '2013-03-05', 'we said with washer men. and with in two or three days he will wash cloths of Physically challenged people.You are requested to provide your name and class whenever you send FAQ.', 1),
('kappa-8', 'sir we will give you support and please arrange an awareness about the condition of this earth and globalization.sir i think that helping hands is not only for the  health and other supports it should also give a bright future.it should help the nature.', '10.2.8.121', 170, '2013-03-08', 'we will think, and definitely we will try to do.You are requested to provide your name and class whenever you send FAQ.', 1),
('puc-1', 'Sir, thank you for giving money of 1000/- to the poor girl students.  We hope helping hands improve in future as a big association. All the best to our helping hands.', '10.2.11.116', 171, '2013-03-11', 'We convey your thanks and wishes to all who contributed money and service in HH. You are requested to provide your name and class whenever you send FAQ.', 1),
('Engg 1 Student', 'Washing Machines are being misused. Some are using them in the name of those who are eligible to use them. And those who are eligible also helping their friends to use washing machines. So try to focus on this problem and save helping hands from misusing. Because Its all students'' property.', '10.3.13.250', 230, '2014-02-04', 'We came to know this problem and introduced maintenance book for washing machine under the guidance of warden.And if you found any misuse, please inform us. You are requested to provide your name and class whenever you send FAQ.', 1),
('Puc-2', 'Sir , the drop box near puc canteen (near Mu classes) getting old . If we drop, money in that how can you collect money because it is rusted.', '10.2.19.93', 236, '2014-02-05', 'We will try to change that box position. Soon we will find another place which is accessible to all students.You are requested to provide your name and class whenever you send FAQ.', 1),
('N090327', 'Great Work.., But update the money collections every week so that we may feel interest to drop a coin in the box..,', '10.3.15.221', 237, '2014-02-06', 'Yes, We will update money collections every week.', 1),
('P1', 'sir please spent some money for daily needs of poor students.because they have not money and please update the weekly collections.', '10.2.26.80', 239, '2014-02-14', 'Helping Hands E.C. allocated 30% of its year budget to the daily needs. It is helping to the students those who are really poor and needy. You can go through the website for expenditure details.You are requested to provide your name and class whenever you send FAQ.', 1),
('PUC', 'Sir, I think PUC students are uninterested in giving money to helping hands, so please motivate them.', '10.2.41.45', 240, '2014-02-15', 'Helping Hands needs volunteer support from students like you. Try to motivate your friends regarding our good work.We are also planning to conduct awareness camp/awareness classes to PUC students.You are requested to provide your name and class whenever you send FAQ.', 1),
('srinivas nayak', 'sir really it is good wonder thought to start helping hands organisation, we should help to developthis organisaton ,we are feeling so good,one more question sir actually whose thought it to start the helping hand organisation', '10.2.39.29', 241, '2014-02-15', 'It was a thought of one of Engg-IV student. His name is Siva. With the help of our college authorities, he achieved his dream.', 1),
('PUC-1', 'Helping hands is very helpful for students to meet their needs. it would be more successful if initiation taken by H.R''s is some what enthusiastic.', '10.2.37.65', 243, '2014-02-17', 'It is a personal responsibility of them. Anyway, we are trying to make in active in their work by conducting regual ar meetings in future.You are requested to provide your name and class whenever you send FAQ.', 1),
('p1-lambda-10', 'Great work Helping hands  organisation.when  will  you  change  the HR''s?\r\n', '10.2.34.47', 245, '2014-02-18', 'As per the rules of Helping Hands,we will change the representatives once in a year.You are requested to provide your name and class whenever you send FAQ.', 1),
('Gopi', 'Sir, In financial details stated that Helping Hands spend the more than ten thousand for annual day celebrations , Annual day celebrations are not included in the motto of our helping hands.Then what is the need of spending that much amount for celebrations.', '10.4.14.165', 246, '2014-02-18', '', 0),
('k-3', 'Some people misusing the help.So it is better to enquire  first before giving the money.Better to ask their friends to give help to them', '10.2.3.12', 247, '2014-02-18', 'We are enquiring to our best. if any misuse happened, Pls bring it to the notice of Batch representatives or working committee or you can inform through website even.We will definitely take action on it. Helping Hands is against for that.\r\nYou are requested to provide your name and class whenever you send FAQ.', 1),
('P2', 'Sir. pls arrange a link opinion of the students not consider this is against the hh', '10.2.20.24', 248, '2014-02-18', 'We have given "Gratitude" link to express your feelings and "FAQs" link for quaries, and "contact us" link for suggestions. These all are for student voice only.\r\nYou are requested to provide your name and class whenever you send FAQ.', 1),
('Student of RGUKT', 'Update the money collection , it is your minimum responsibility', '10.4.3.140', 249, '2014-02-19', 'Sorry for the inconvenience. From today onwards, it will be updated as we got detals.\r\nYou are requested to provide your name and class whenever you send FAQ.', 1),
('HARI', 'My friend is very poor he need some money.My class HR send a letter but not response to you please grant some money to my fried ', '10.2.26.80', 250, '2014-02-19', 'Please bring the this issue to the notice of your cluster or batch representatives.', 1),
('GSNL Gayathri', 'Your work is very good.But it is better to update the money collection and usage.So that we will get more interest to help the people.', '10.2.3.12', 251, '2014-02-19', 'Due to technical problems we were failed to update.\r\nNow we updated total money collections and debit details.\r\nThank you.', 1),
('lokesh', 'Sir, \r\n         yesterday(18-02-2014) we collected 57 rupees from lambda 08\r\n       but in the website of helping hands is shown as 78rupees ', '10.2.32.100', 252, '2014-02-19', 'Due to carefreeness of cluster/batch representatives, this kind of problems are arising. They are mingling the individual class collections. Actual money collection details are: Lamda7 = 44 Lamda8 = 57 Lamda9 = 79 Lamda10 = 87 Lamda11 = 87 Lamda12 = 44 Omega12 = 88. We will focus on this problem and rectify it. But as per the record total money collected from PUC-1 students on 18-02-2014 is 1487/-\r\nAnd there is no missing of our money. Thank you.', 1),
('HR lambda9', 'Sir, this week our class collection is 79 rupees but on the link you provided it is given as 37 rupees . So please rectify it .\r\nthank u sir', '10.2.33.28', 254, '2014-02-20', 'Due to carefreeness of cluster/batch representatives, this kind of problems are arising. They are mingling the individual class collections. Actual money collection details are: Lamda7 = 44 Lamda8 = 57 Lamda9 = 79 Lamda10 = 87 Lamda11 = 87 Lamda12 = 44 Omega12 = 88. We will focus on this problem and rectify it. But as per the record total money collected from PUC-1 students on 18-02-2014 is 1487/- And there is no missing of our money. Thank you.\r\nYou are requested to provide your name and class whenever you send FAQ.', 1),
('HR', 'Sir please, conduct the  meeting in Puc1-, L-2 class. I want to make my friends to know all the matters which have been done in  the organisation. As a HR it is my responsibility but they wanted to listen on your words.  So, I requesting you ,to arrange the meeting in L-2', '10.2.26.105', 256, '2014-02-22', 'We will discuss and take decision on the awareness classes. Lambda cluster is only remain in PUC-1.\r\nYou are requested to provide your name and class whenever you send FAQ.', 1),
('ushalatha', 'If there is any helping hands meeting please inform to all the HR''s before itself.', '10.5.12.123', 258, '2014-02-24', 'If there is any meeting, we will inform to your batch representatives before stipulated period. If miscommunication happened, that is purely by your batch representatives only. From next time onwards we will intimate them with some more extra time so that no miscommunication occurs.', 1),
('lambda ', 'sir when would u change our class H.R?', '10.2.35.151', 260, '2014-02-24', 'As per rules of organisation, representatives will be elected once in a year.You are requested to provide your name and class whenever you send FAQ.', 1),
('p2', 'When did you organise the eye camp.', '10.2.20.24', 264, '2014-02-25', 'We will inform you regarding health camp. before that if you need any help from Helping Hands you can reach us through HR of your class or batch representative of your batch.You are requested to provide your name and class whenever you send FAQ.', 1),
('ASHA', 'when will you solve the dhobi problem they are not getting dhobi from long time ..    please solve the problem as early as possible...............', '10.2.31.33', 265, '2014-02-25', 'Sincerely, At present no dhobhi is available in campus.Dhobhi (Basavayya) has left the campus with whom we have an agreement. We are searching for new dhobhi. We will try to resolve this problem as early as possible.keep your faith on Helping Hands.Thank you.', 1),
('lambda-01 HR', 'Sir we are not getting dobi charges for handicapped  student. What do should we do.please tell me sir?', '10.2.25.144', 266, '2014-02-25', 'Every month we are providing dhobhi charges to 17 members of PUC about 1700/- If the person is not in that list ask him/her to write a letter to Helping Hands with proper proofs,So that Executive committee can able to take decision on it. Thank you.You are requested to provide your name and class whenever you send FAQ.', 1),
('HEMA', 'DOES ALL THE POOR MEMBERS GETTING HELP ?PLZ GIVE ME ANSWER .', '10.2.32.71', 267, '2014-02-25', 'Yes,We are giving our support to needy if they are deserve it, as per the rules of Helping Hands.', 1),
('Ramesh', 'Sir, When was conducted eye camp ?', '10.2.32.83', 268, '2014-02-25', 'We will inform you regarding health camp. before that if you need any help from Helping Hands you can reach us through HR of your class or batch representative of your batch.', 1),
('lambda', 'sir when will you conduct the health camp plz answer this que.....', '10.2.31.12', 270, '2014-02-26', 'We will inform you regarding health camp. before that if you need any help from Helping Hands you can reach us through HR of your class or batch representative of your batch.You are requested to provide your name and class whenever you send FAQ.', 1),
('HR', 'sir handicapped students are not getting dhobi charges please solve this....pro..THANK U SIR', '10.2.31.12', 271, '2014-02-26', 'Every month we are providing dhobhi charges to 17 members of PUC about 1700/- If the person is not in that list ask him/her to write a letter to Helping Hands with proper proofs,So that Executive committee can able to take decision on it. Thank you.You are requested to provide your name and class whenever you send FAQ.', 1),
('BHAGYASRI', 'Sir,I am MUE cluster hr.I submitted money of all classes in mue block.But last week m-4,m-5 money are not updated in website.What''s the reason for this???????????', '10.2.37.140', 272, '2014-02-26', 'This problem has been resolved. Please check it once. Thank you.', 1),
('ranjit ', 'can you update this week collection', '10.2.26.120', 273, '2014-02-26', 'On every wednesday weekly collection will be updated. ', 1),
('veerakrishna', 'when do you conduct health camp?\r\n', '10.2.1.222', 274, '2014-02-26', 'We will inform you regarding health camp. before that if you need any help from Helping Hands you can reach us through HR of your class or batch representative of your batch.', 1),
('M-4', 'Why my room money not displayed last week', '10.2.37.140', 275, '2014-02-26', 'This problem has been resolved. Please check it once. Thank you.\r\nYou are requested to provide your name and class whenever you send FAQ.', 1),
('GOPI_N130318 P1', 'dobi another time asking money what we can do she was asking very forcingly we are get''s confusingness you don''t pay money please give reply my ph no;9494918564 please send or give reply before evening\r\n', '10.2.28.137', 276, '2014-02-26', 'We talked with dhobi regarding your problem,there will be no problem from now onwards. And we arraged a new dhobi for you people. If any problem is further, please bring it to our notice.', 1),
('Sravani', 'Sir,When was conduct eye camp?', '10.2.32.83', 279, '2014-02-28', 'We will inform you regarding health camp. before that if you need any help from Helping Hands you can reach us through HR of your class or batch representative of your batch.', 1),
('tadichandu k-7', 'what is biggest use of helping hand explain sir.how the helping hands help the poor students explain sir', '10.2.24.37', 280, '2014-03-01', 'Helping Hands doing help to the poor people by giving daily needs, medical charges, travelling charges to whom approached to the helping hands. In above mentioned things, each and every one one is biggest one.', 1),
('L-8 STUDENT', 'When you conducted eye camp?Plz give answer for this question.', '10.2.32.72', 281, '2014-03-01', 'We will inform you regarding health camp. before that if you need any help from Helping Hands you can reach us through HR of your class or batch representative of your batch.You are requested to provide your name and class whenever you send FAQ.', 1),
('Sunil Raiyani', 'Dear students,\r\n  Related to Health camp, in short future going to held. Our new chairman of HH is trying and sparing his valuable time to short-out these camp. ', '10.1.3.11', 282, '2014-03-03', '             ', 1),
('Sunil Raiyani', 'Biggest use of helping hand at presently medical and daily needs. It made to your colleague only.\r\n\r\nDhobi charges are paying time to time. It may be delayed for month of Dec/Jan because our RGUKT students went for vacation during that time.\r\n\r\nIf you would like to know that poor students getting help. Join HH, you will get feel of it.\r\n\r\nI will request to concern team to update the collection and distribution of money properly & accordingly it was collected distribution from/to your cluster. If any students want details of howmuch money deposited in HH. There will be account in our RGUKT HH account you will get from there. \r\n\r\nRegarding the misusing of Washing Machining, I think who are misusing that student have to understand/feel its made for really needy students. We can not change the mind of students, we all are here to help our students. ', '10.1.3.11', 283, '2014-03-03', 'It is a post from Sunil Raiyani (faculty_Civil Dept)\r\nwho is shouldering responsibilities of account section of Helping Hands.', 1),
('venkatesh from M-3', 'hello sir we have  one doubt that is when we are  faceing  a problem in emergency situation then we need help of your  then what we do ! could you please give the answer sir', '10.2.39.39', 284, '2014-03-03', 'As Helping Hands wants to get the stage of NGO, we are forming some rools and regulations on these emergency category. Resolved ideas will be displayed soon in website.', 1),
('HH MEMBER', 'Your updating money collection its ok but the graphs are not updating ...... try to solve it...........         ?', '10.3.31.90', 285, '2014-03-03', 'Graphs will be updated as and when we update the money datials. \r\n\r\nThank you.', 1),
('HYD', 'sir could you give me please information to this question ! that is The Helping hands organisation is which type of programme conducted till this year ??', '10.2.39.39', 286, '2014-03-03', 'Helping Hands conducted many programs till now, we planning for future even.\r\nThe programmes are listed below.\r\n1.Serving meals to Oldage home people.\r\n2.We have given healthy food packs to sneha rides who are suffering from various deseases.\r\n3. We arranged a orchestra by blind people and we helped them by collecting money for them.\r\n4. We conducted health camp is one aspect(skin).\r\n\r\nWe conducted many programmes like these, but these are major.\r\nYour are requested to mention your name    while giving FAQ.\r\nThank You.', 1),
('Ramakrishna', 'Sir, please  try to spend some more money on health.Many students are suffering from typhoid.', '10.2.25.96', 287, '2014-03-03', 'We will itmitate it to the working committee, and we will discuss on it.\r\n\r\n\r\nThanking you.', 1),
('PUC1 student', 'sir'' when  you are conducting the eye camp.......? , so many people suffer from eye problems so immediately action this matter.   ', '10.2.24.35', 288, '2014-03-03', 'We will inform you regarding health camp. before that if you need any help from Helping Hands you can reach us through HR of your class or batch representative of your batch.You are requested to provide your name and class whenever you send FAQ.', 1),
('P1 LAMBDA', 'When did you conduct eye camp?And another one, We want to join in HH as volunteer can please selected for that?', '10.2.29.235', 291, '2014-03-04', 'We will inform you regarding health camp. before that if you need any help from Helping Hands you can reach us through HR of your class or batch representative of your batch.You are requested to provide your name and class whenever you send FAQ.', 1),
('D.Naga sai', 'when will we become  the VOLUNTEER of helping hands?', '10.2.29.236', 292, '2014-03-04', 'As you are aware of Helping Hands, they are no designations in our Organisation. Every IIITn is volunteer of our system. If ''VOLUNTEER'' word is included in NGO draft we will intimate you regarding this concept.', 1),
('puc-1', 'Sir,when we are expressing our gratitude you are not publishing the messages given by  us\r\n on the link you provided for helping hands. please take an  action over it.', '10.2.33.28', 294, '2014-03-04', 'Gratitude will not be published unless you provide your details properly.\r\nYour are requested to mention your name while giving FAQ. Thank You.', 1),
('Venkat', 'Sir,when was conducted eye camp? we are wait for that.', '10.2.32.81', 295, '2014-03-05', 'We will inform you regarding health camp. before that if you need any help from Helping Hands you can reach us through HR of your class or batch representative of your batch.', 1),
('G.Syamladevi', 'Sir would you conduct the awareness meeting in Lambda cluster? Please sir, it is essential to my friends, I am HR of the L-2 class, I already explained some topics which we were discussed in last awareness meeting. But I want,  to know them of your own words. Please arrange the meeting as soon as possible.', '10.2.26.154', 296, '2014-03-05', 'We came to aware the students regarding Helping Hands with proper permissions from Ramanarasimham sir. \r\nBut lambda cluster HRT did not allowed the Helping Hands team members into class rooms.\r\nAny how, we are planning to conduct awareness camp for the PUC students.\r\nWe will soon take decision on it and come to you.\r\nThank you.', 1),
('Siva Kesav', 'Provide the date for when will the health camp held in our campus, which you was announced?', '10.4.12.172', 297, '2014-03-05', 'We will inform you regarding health camp. before that if you need any help from Helping Hands you can reach us through HR of your class or batch representative of your batch.You are requested to provide your name and class whenever you send FAQ.', 1),
('ramesh', 'can you give a short film for helping hands in website', '10.2.26.80', 299, '2014-03-05', 'We are thinking of make documentary on our Helping Hands.\r\nRight now we don''t have availability of short film on organisation. If you are interested to join with us please consult your batch representative. thank you.', 1),
('ramesh', 'my friend got money after 3 weeks why do you delay?tell me', '10.2.26.80', 300, '2014-03-05', 'Can you please elaborate the details regarding this FAQ. \r\nSo that we can able to answer you.\r\nThank you. ', 1),
('R.Durga Prasad   CE-02', 'Respected sir,\r\n                     Recently so many students suffering from stomach ache. From puc-1 to E-4 all students are facing this problem. We thought there is a some problem in our drinking water that''s why all students are suffering. Please test our drinking water. "" Prevention is better than cure "". You always helps deserved people. If you take action regarding this it will be helpful to students. Thank you sir.', '10.5.27.114', 301, '2014-03-05', 'Regarding these kind of problems administration has to take care. Consult concern authority in writing. and if you can able to provide any proofs on this problem,Helping Hands definitely move forward. Thank you. ', 1),
('Keerthi', 'Sir,many of the students are ill because of food,weather etc,can we have health camp as soon as possible?so we can able to treat them.....it was postponing for a long time', '10.3.21.13', 303, '2014-03-06', 'We are working on it. sorry for the delaying the program.\r\nwe will make it complete soon.', 1),
('Divya', 'this week M-3 is given heighst  amount but you show M-1 in percetage link please check this .....tahnk u sir', '10.2.31.222', 304, '2014-03-06', 'Those Percentage graphs are not generated for Every week, but for Total money Contributed from that class till now.', 1),
('J.RAMAKRISHNA', 'Sir, my friend is suffering from some problems. he hasn''t enough money to go home. He feels shy to report you. so sir where can I consult you?', '10.2.41.149', 305, '2014-03-06', 'Consult your class Helping Hand representative or your batch representative they will guide you.', 1),
('student', 'plz resolve the problem of spinter.in the washing machine', '10.5.1.199', 308, '2014-03-06', 'We will check it and make it clear if you can reach us what exactly problem is through your HR of class. Thank you.', 1),
('WELL WISHER', 'Your entring the details of CREDIT why your late in entring the details of DEBIT??????????????????', '10.3.31.90', 314, '2014-03-06', 'Time to time we are updating the\r\ndebit details also.\r\nBut, thing is we are not notifying it as credit details.\r\nyou are suggested  to check it once.\r\nYour are requested to mention your name while giving FAQ. Thank You.', 1),
('N130377', 'Sir,Why didn''t you display my gratitude, which was kept on 06.03.2014.?', '10.2.29.235', 315, '2014-03-07', 'Gratitude will not be published unless you provide your details properly. Your are requested to mention your name while giving FAQ. Thank You.', 1),
('Sarala', ' \r\n    Sir, many students will have desire to serve the people and they may waiting for that chance so try to give the chance to other students also', '10.3.15.24', 316, '2014-03-07', 'Every student of IIITN is part of Helping Hands. Don''t feel that you are not playing key roll. Everybody can''t get opportunity at a time. Thank you.', 1),
('Venkat', 'Sir,When was conducted eye  camp/', '10.2.32.81', 317, '2014-03-07', 'Health camp will be conducted within two weeks with the aspects  (skin and ENT and Gynaecology (only for girls).\r\nEye camp will be conducted after these things.\r\n\r\nThank you.', 1),
('student', 'will you give money to help to people whose parents of the students?', '10.2.33.122', 318, '2014-03-07', 'Please post the FAQ clearly.\r\n\r\nThank you.', 1),
('K.V RAMESH', 'Sir, when was health camp conducted???please answer me!!!!!!!!!!!!!!!!!!!!!!!!!!!!', '10.2.32.186', 319, '2014-03-07', 'Health camp will be conducted within two weeks, and for that we conducting survey today. \r\n\r\nThank you.', 1),
('p2', 'SIR. when was conducted eye camp.', '10.2.20.24', 322, '2014-03-10', 'Health camp will be conducted within two weeks, and for that we conducting survey today. Thank you.We have already given answer for this. Please see below questions. Thank you.', 1),
('N130550', 'Sir you haven''t updated  the gratitude column from 19-feb-2014 . I have expressed my gratitude 2 times \r\nbut  until now no other gratitude is being displayed .What''s the reason aren''t we mentioning  our name and mane and details or any technical problem?\r\n', '10.2.33.28', 323, '2014-03-10', 'Sorry for the inconvenience. Problem is that all are posting same things like "thank you helping hands"..\r\nWe are expecting a gratitude which has versatile in nature which makes everyone inspire. \r\n\r\nPlease express your gratitude in such a way that, those who are reading them, they should inspire with that.\r\n\r\nThank you. ', 1),
('PAVANI', 'why can''t you make puc 1 girl students make use of washing machine sir ? I think it will be fine.......... thank you sir....... ', '10.2.13.212', 324, '2014-03-10', 'We have security problem in puc campus to keep the washing machine in one particular room and we dont have that sigle room facility even. That is why, we arranged dhobi for puc students who are staying old campus.\r\n\r\nThank you', 1),
('P1', 'SIR YOU SAID THAT THERE IS  DHOBI FACILITY FOR P1 GIRLS  BUT SHE IS NOT COMING AT ALL. IS THERE ANY REASON BEHIND IT???', '10.2.33.123', 326, '2014-03-12', 'We have provided a washing machine in k3 block for the girls staying K2,K3 and K4.\r\nWe got a notice that some of the puc students are in K4 even. If there are any PH students in K4, they have to go for washing machine only and dhobi is for the girls and boys who are staying in Sigma,theta and eta,alpha,gamma i.e. old campus.\r\n\r\nThank you.', 1),
('hr', 'In  GRATITUDE  link the posts are not in sequence .Please put the posts in date wise ...', '10.3.16.140', 328, '2014-03-12', 'We will try to rectify it.\r\n\r\nThank you.', 1),
('P1', 'SORRY SIR!!! YOU HAVE MISTAKEN. P1 GIRLS ARE STAYING AT SIGMA AND THETA (OLD CAMPUS) ONLY AND DHOBI IS NOT COMING FOR THEM.COULD YOU PLEASE LOOK UPON THAT MATTER????????', '10.2.33.123', 329, '2014-03-12', 'Please carry this issue to the notice of your batch representatives. Their names and classes are displayed in site.\r\nActually we arranged dhobi for them.\r\nWe will rectify that problem.\r\nIf you have any further problems, please call to this no:9666401252.\r\n\r\nThank you.', 1),
('L-4', 'You are doing a good job.please give the chance of being helping hands representative to all the students.please think about it.we all want to service through helping hands.', '10.2.28.52', 334, '2014-03-12', 'As it is growing like big organization, we should maintain the rules perfectly. As per the rules of the Helping Hands, we will change the representatives once in a year.\r\n\r\nThank you.', 1),
('lambda 5', 'Sir, please conduct the motivation class for PUC students in their respective classes, so that we get an idea on HH. I hope you will conduct early.', '10.2.29.113', 335, '2014-03-12', 'For that, we came to your classes. But some people are restricting us. We will try to be infront of you in next week.\r\n\r\nThank you.', 1),
('student', 'Sir, Why are you using the local website ? please make this website all over accessible outside also , so that we can see the recent and most important things happening in our holidays also.', '10.5.27.3', 336, '2014-03-12', 'We are trying to get the recognization from NGO. As we got that, we will start web outside also. But it will take some time.\r\n\r\nThank you.', 1),
('E-3', 'site is very slow try to impove', '10.3.19.64', 337, '2014-03-12', 'We are trying our best.\r\n\r\nThank you.', 1),
('P.M.D.S-L-7', 'I think HR''s need some special ID cards or special appearance in ID''s .When will you change HR''s?', '10.2.31.177', 338, '2014-03-12', 'We will carry your thought to the notice of E.C. and regarding representatives, we already given the answers. please check below questions. We are requesting you to give your name while giving FAQ. Thank you. ', 1),
('HEMA ', 'WHEN WAS YOU CONDUCTED AWARENESS PROGRAMME SIR???????????????????', '10.2.33.17', 340, '2014-03-12', 'As we are trying for NGO recognization, we making rules in a new way. As it is completed, we will be infront of you.\r\n\r\nThank you.', 1),
('L5 HR', 'Thank you for giving immediate answer for my FAQ. If you want to come to classes please intimate it before we will support you sir.', '10.2.29.113', 341, '2014-03-12', 'We will definitely inform to as and when schedule prepared.\r\n\r\nThank you.\r\n', 1),
('', 'OUR INSTITUTION HAD GOOD REPUTATION . WHY DON,T YOU COLLECT MORE MONEY FROM OUTSIDE?IS THERE A NY PROBLEM ?', '10.2.33.31', 342, '2014-03-12', 'No, till now, our main aim is to make the RGUKT students(needy and poor) free from economical problems.\r\nAnyway we will carry your thought to E.C.  and we will respond for this.\r\n\r\nWe are requesting you to give your name while giving FAQ.\r\n\r\nThank you. ', 1),
('HEMASRI', 'IS THIS MONEY HELPFUL TO ALL STUDENTS???????????????????????????', '10.2.33.17', 343, '2014-03-12', 'The money given by you people is perfectly fulfilling its significance.\r\n\r\nIf you want check, you can enquire your batch representatives.\r\n\r\nThank you.', 1),
('good friend...', 'This money is distributed to the correct time to correct people?', '10.3.16.105', 345, '2014-03-12', 'We have answered this question before. Please go through below page.Please mention your name while giving a FAQ. Thank you.', 1),
('L5 Students', 'Thanks for giving chance to behalf  of Helping Hands.', '10.2.29.39', 346, '2014-03-12', 'Please express your gratitude in gratitude page. This page is only for your queries.\r\n\r\nThank you.', 1),
('P1 STUDENTS', 'Please mention the week collection details', '10.2.32.135', 347, '2014-03-12', 'Sorry for the inconvience, it will be updated by today evening.Please mention your name while giving a FAQ. Thank you. ', 1),
('siva L-7', 'the webside is very slove so please rectifie it ......thanku..sir', '10.2.31.12', 348, '2014-03-12', 'We are trying our best.\r\n\r\nThank you.', 1),
('Well Wished', 'site is loading very slowly..\r\nkindly make a view of this.', '10.4.19.11', 349, '2014-03-12', 'We are trying our best to resolve this problem.\r\nPlease mention your name while giving a FAQ.\r\n\r\nThank you.', 1),
('D.Navyakruthi', 'Does helping hands exists in R.K.Valley & Basara?', '10.2.22.11', 352, '2014-03-12', 'We dont exactly, they have something but not in this level.\r\n\r\nIn our college only it is running efficiently.\r\n\r\nThank you.', 1),
('AHLADITHA ANGEL', 'most of the students are not showing any interest to give even a rupee.please teach them the importance of helping. Help the poor sufficiently.', '10.2.26.53', 353, '2014-03-12', 'We are trying our best to help the poor people. Giving money is their interest and responsibility. Anyway we will try to make them aware of things to our best.\r\n\r\nThank you.', 1),
('haranadhL2', 'Why don''t you arrange user ID and  password for helping hands as well as ONB and other websites. It makes users privacy', '10.2.26.190', 354, '2014-03-12', 'We have given credentials to you. As it is a social and charitable site, it should be open to all and we will make security provisions wherever required.\r\n\r\nThank you.', 1),
('one friend', 'Is the mentors giving  money for helping hands.', '10.2.26.190', 356, '2014-03-12', 'One mentor(Saleem sir) is giving Rs.500 everymonth. We dont know about others. They give oftenly. We dont have any records of them from 2013.Please mention your name while giving a FAQ. Thank you.', 1),
('charan', 'If you don''t mind  the food in the mess is very bad we want to solve it but some friends are not coning along with us can you solve it.', '10.2.26.190', 357, '2014-03-12', 'Till now, we didn''t enter into this type of problems, any way, will carry this to the notice of E.C. Please meet your batch representatives and give your details. We will give our response to them. Thank you.', 1),
('chaitu', 'please explain how health camp was.can you give specticlas ?', '10.2.26.190', 358, '2014-03-12', 'Sorry, please go through the survey site. We mentioned clearly that we will provide consultency only. If your are under the criteria of daily needs,you can approach to the Helping Hands.\r\n\r\nThank you.', 1),
('M.Divya vani', 'blood can give below the age of 18 years students and  are they take blood once or more than that?  if below 18 years students registered  for the blood camp are they will take the blood or not?', '10.2.3.71', 359, '2014-03-12', 'Blood can be taken from the them who crossed 18 years limit.\r\nThe aim of this programme is not to take the blood at once. We will create one helpline number which will circulate through out A.P. \r\nWhen they required, they will call us. And all allowances to that particular students should take care by benificiary only.\r\n\r\nThank you.', 1),
('JHANU', 'IT IS USED ONLY IN OUR CAMPUS OR OTHERS ALSO?', '10.2.33.142', 361, '2014-03-12', 'In Helping Hands year budget, 90% of money is allocated for inside campus, and only 10% of money is allocated for outside charities.\r\n\r\nThank you.', 1),
('N130541', 'Sir you have provided a link for registration of helping  hands for students . What''s the main purpose of it and also you have requested to provide blood group details .If the donor is unwilling to donate blood after  registration then what''s the matter .Is it mandatory for every student or he can submit that he is unwilling to donate the blood.\r\n', '10.2.33.28', 362, '2014-03-12', 'It is mandatory for all students. We have answered this question before. please go through below questions.\r\n\r\nThank you.', 1),
('VINAY N', 'Sir, We need dental camp in our campus.', '10.2.12.15', 363, '2014-03-13', 'We will carry your requirement to the notice of E.C. and we will respond you soon.\r\n\r\nThank you.', 1),
('SIVA', 'gratitude''s are not in proper order by date wise please try to put them in proper order........thank u sir........', '10.2.31.12', 365, '2014-03-13', 'We will try to rectify this problem as early as possible.\r\n\r\nThank you.', 1),
('L-10 student', 'When will  you  conduct the awareness meeting sir? Is there  any  awareness meeting  in this  month sir?\r\n\r\n', '10.2.34.188', 366, '2014-03-13', 'yes, surely it will be in this month only.We are requesting you to mention your name clearly while giving a FAQ.  Thank you.', 1),
('RESPONSIBLE PERSON', 'IS THERE ANY MISUSE OF HELPING HANDS MONEY TILL NOW?', '10.2.33.57', 367, '2014-03-13', 'Till now, no one found in this aspect. \r\nWe are requesting you to mention your name clearly while giving a FAQ. \r\nThank you.', 1),
('RESPONSIBLE RGUKT STUDENT', 'IF HELPING HANDS DO THEIR PROPERTIES REGURALLY?', '10.2.24.26', 369, '2014-03-13', 'Please write your query clearly.\r\n\r\nWe are requesting you to mention your name clearly while giving a FAQ.\r\n\r\nThank you.', 1),
('nagendrababu', 'can you update weekly collection?', '10.2.26.190', 370, '2014-03-13', 'Sorry for the inconvience, we will update by today evening.\r\n\r\nThank you.', 1),
('SK.Saidavali.', 'I donated blood.but i don''t no my blood group.', '10.2.25.78', 371, '2014-03-13', 'Please ask relevent questions for helping hands.\r\n\r\nThank you.', 1),
('John', 'Can you give the names of members in Organisation,including class hrs & cluster hr & branch hr? By list vise in helping hands site.', '10.2.27.156', 372, '2014-03-13', 'We have already provided these data at STRUCTURE link.Check it once.\r\nThank you.', 1),
('well wisher ', 'your condundected awarness for only few clases in puc-1 when will con...awerness..to other remaining clases  in p-1 please do this as early as posible sir it is better..thank u sir', '10.2.31.12', 376, '2014-03-13', 'We came to aware the students regarding Helping Hands with proper permissions from Ramanarasimham sir. But lambda cluster HRT did not allowed the Helping Hands team members into class rooms. Any how, we are planning to conduct awareness camp for the PUC students. We will soon take decision on it and come to you. We are requesting you to mention your name clearly while giving a FAQ. Thank you.', 1),
('siva ', 'sir your showing wrong percentages in graphs link please rectifi...it ...thank u sir............', '10.2.31.12', 378, '2014-03-13', 'We will verify it manually and rectify it if any found.', 1),
('siva', 'sir your doing very good work it is good think being part of us in service by gaving chance  to donate blood ..sir i think if you do more thinks like this you will get good response from the students ..thank u sir', '10.2.31.12', 379, '2014-03-13', 'Thanks for your response.\r\nWe always try to increase the glow of Helping Hands\r\n\r\nThank you.', 1),
('puc', 'Why are E4 students not giving money to the organisation as everyone is punctual enough in giving one rupee per week.', '10.2.33.28', 381, '2014-03-13', 'Since, All our E4 friends are busy with their career planning and campus placements so they are not donating money. But they are all with the Helping Hands as a supportive ground.', 1),
('viswa teja O-4', 'Sir,when you started local website for helping hands we want to see helping hands updates in outside also.', '10.2.32.83', 382, '2014-03-13', 'Please post your query clearly.\r\n\r\nThank you.', 1),
('Veera Ramesh Babu', 'Helping Hand Washing Machines Are Arranged For PH Students.It Is Correct Or Not?', '10.5.9.67', 383, '2014-03-13', 'Yes, Those are purly for Ph students only.\r\n\r\nThank you.', 1),
('RAMYA', 'IS THERE ANY MISUSE OF MONEY? SIR \r\nARE YOU GIVING SUPPORT IMMEDIATELY  FOR PEOPLE WHO ARE NEEDY?', '10.2.34.43', 384, '2014-03-13', 'Please ask this query to your cluster or batch representatives so that you can realise the problem. It is just to realise you the things. Then you post your opinion. We will answer your query.\r\n\r\nThank you.', 1),
('p.chowdeswari', 'i am chowdeswari  from o-1. i want to donate blood but i don''t know my blood group .i was  gave to you "no" option in yesterday''s servay but now  i want  to donate . what  i will do sir? please give  answer my question as fast as possible. thank you sir.............................', '10.2.13.110', 385, '2014-03-13', 'Please approach to your class helping hands representative with this thing on paper. Please ask her to forward it to W.C. Then we will change your option.\r\n\r\nThank you.', 1),
('kanth&krishna', '                              In 2011 you had initiated a good work of collecting used books&news papers in a semester,and more over you had collected nearly 1lakh rupees.BUT now you stopped that idea,what''s the reason behind that? Nearly thousands of books were going into dumping yards wastely,\r\n                In my opinion it will be very good if you restart that idea...\r\n', '10.3.24.169', 387, '2014-03-13', 'Sorry to differ with you, we didn''t stop the thing. Only for E4 students, it was not done. Remaining for all other batches it is going on.\r\n\r\nThank you', 1),
('Shankar', 'What will be the plans of  "Helping Hand" in near future?', '10.4.4.134', 388, '2014-03-13', 'Health Camp in skin, ENT and gynaecology (for girls) in upcoming two weeks. Then next, Awareness camp to whole RGUKT people. After that Eye camp. Upto these things were finalised. \r\n\r\nThank you.\r\n\r\n', 1),
('U.Siva Kumari', 'sir u are not shown the money details of M-4,M-5 clases which was collected in 13-03-2014 in the notification''s. so please check them and rectify it ....thank you sir..........', '10.2.31.12', 390, '2014-03-14', 'We are facing technical problem in this area. we will try to rectify it soon.\r\n\r\nThank you.', 1),
('NAGA SRI HARSHA', 'SIR,IT IS BETTER TO PUT ''FORGET PASSWORD'' OPTION IN THE LOGIN AREA OF HELPING HANDS WEBSITE', '10.2.37.148', 392, '2014-03-14', 'We will give that option soon.\r\n\r\nThank you.', 1),
('NAGA SRI HARSHA', 'SIR,in the class mue 1,my classmates baring i.d no N130754 & N130753 were getting their class as omega 10.i being the H.R of mue 1 requesting you to rectify it.so plz rectify it and make them happy.', '10.2.37.148', 393, '2014-03-14', 'In our database, it was like omega only.\r\nplease report this to your HR on paper. We will rectify it.\r\nThank you.', 1),
('mue 1 H.R', 'sir, in my class, 2 members baring I.D no:n130752 & n130779 cant login their accounts.so kindly solve our problems and reply me soon sir.thank you', '10.2.37.148', 394, '2014-03-14', 'Please mention the problem clearly. Whether it is password problem or data problem.\r\n\r\nAnyway we will try to rectify it.', 1),
(' js', ' what is the total collected helping hands money up to now?', '10.3.24.223', 395, '2014-03-14', 'Send your FAQ with proper details.\r\nyou didn''t mention your name.\r\nthank you.\r\n', 1),
('Mue 4', 'Sir,\r\nWe are from mue 4.Our Money Details are not in the list.Last week also we haven''t found our details. What happend to our Money??', '10.2.40.42', 396, '2014-03-14', 'Regarding M-4 and M-5 classes we are facing technical problem. We will make it clear in server room and come to you. Sorry for the inconvenience. ', 1),
('B.Sai ram gopal', 'How will you ensure that proper functioning is taking place and the functioning of collecting money is used properly.\r\n', '10.2.33.28', 397, '2014-03-14', 'We are requesting you to visit HH office with your batch representatives to see all records of past. Then you will realise the thing. Thank you.', 1),
('Gajja Viswa ', 'Sir,when you are started local website of helping hands.we want to see helping hands updates out side also.like rgukt wensite.', '10.2.32.83', 399, '2014-03-14', 'We will propose this issue in E.C. we will get back to you soon.\r\n\r\nThank you.', 1),
('mue1 h.r', 'It is better if u provide an oppurtunity of forgetting password', '10.2.37.140', 400, '2014-03-14', 'We will creates soon.\r\n\r\nThank you.', 1),
('', 'IS DHOBI PROVISION FOR PHYSICALLY HANDICAPPED STUDENTS ONLY?????????CANT THE OTHERS HAVE DHOBI BY PAYING THEM?????????', '10.2.33.123', 401, '2014-03-14', 'Helping Hands arranged dhobi for physically challenged people only, not for others. Other than those two dhobis(arranged by hh) you can arrange by yourself.\r\n\r\nThank you.', 1),
('SK RASOOL', 'Sir,please tell me, What is the total collection of helping hands up to now.', '10.2.32.83', 403, '2014-03-14', 'It is around 7.85 Lakhs.If you want further details, please contact HH authority.\r\n\r\nThank you.', 1),
('P', 'it has better to modified the FAQ login menu. That is user id &  craated HH pwd\r\n', '10.2.27.101', 405, '2014-03-15', 'We will do that soon.\r\nThank you', 1),
('MUE CLUSTER', 'PLEASE...SOLVE THE ISSUES QUICKLY...1)COLLECTION DETAILS OF MUE3,4 ARE NOT DISPLAYED..\r\n2)THE PROBLEMS FACED IN LOGGING HAVE TO SORTED OUT QUICKLY..\r\nPLEASE ENSURE THAT ....YOU UPDATED...', '10.2.19.100', 406, '2014-03-15', 'This problem has been solved, If further problem is there please contact 9666401252.\r\n\r\nThank you.', 1),
('N130579-SANGHAVI', 'H.Hands organization  only in our  or basara and idukulapaya also?', '10.2.33.142', 407, '2014-03-15', 'There is one organisation in Basar campus to help the students.\r\nIt is running by some other authority not by the students like us. Thank you. ', 1),
('Nagamani', 'sir helping hands helped all poor students?', '10.2.33.18', 408, '2014-03-15', 'Yes, Helping Hands is for poor people only.\r\n\r\nThank you.', 1),
('PUC 1', 'IS DHOBI FACILITY FOR ONLY PHYSICALLY HANDICAPPED STUDENTS???CANT YOU ARRANGE DHOBI FOR OTHER STUDENTS WHO ARE WILLING TO PAY FOR IT???IT SEEMS THAT DHOBI IS NOT COMING FOR PH GIRLS TOO', '10.2.33.123', 409, '2014-03-18', 'Helping Hands arranged dhobi only for physically challenged people but not for others.\r\nRegarding other people, they have talk to that persons only.\r\n\r\nThank you.', 1),
('Gajja viswa', 'sir kindly tell me, what is your total collection.', '10.2.32.83', 410, '2014-03-18', 'We will try to incorporate the total details for next week onwards.\r\n\r\nThank you.', 1),
('A.Asraya kumari L12 H.R', 'when the health camp and blood camp will be conducted? it is better visit p1 students ..', '10.2.36.19', 411, '2014-03-18', 'Health camp will be conducted within one week.\r\n\r\nThank you.', 1),
('p2', 'I am posted you about the conducting time of eye camp on 15/3 but I can''t get your response still.', '10.2.20.24', 413, '2014-03-18', 'Sorry for the inconvience. Eye camp will be conducted in next edision of Health Camp. \r\n\r\nThank you.', 1),
('HR', 'if tuesday is holiday then how about the money collection for helping hands??????', '10.2.33.123', 415, '2014-03-18', 'As per rules of Helping Hands, if tuesday is holiday, money collection will be done on wednusday(Reserve day).\r\n\r\nThank you.', 1),
('puc ', 'Respected Sir , If anyone has received help from your organisation and they want to express their gratitude as you are not publishing any gratitude then how they will express their feelings and happiness?', '10.2.33.28', 416, '2014-03-18', 'This is our problem. We will try to rectify it. Problem is that we have two persons to give answers for site. We will try to make the team strong with some more members so that you dont have any problem.\r\n\r\nThank you. ', 1),
('Chinna', 'Sir,when did held health camp?', '10.2.26.84', 419, '2014-03-18', 'It will be conducted with in one week.\r\n\r\nThank you.', 1),
('P2', 'When will you conduct health camp?', '10.2.2.14', 422, '2014-03-19', 'It will take one week time as and when the survey completed, we will go further in procedure.\r\n\r\nThank you.', 1),
('sannapureddy srinivasareddy L-8', 'Sir, I want to know your total collection. please tell me.', '10.2.32.83', 423, '2014-03-19', 'It is around 7.85 lakhs. If you want further details, please contact HH authority.\r\n\r\nThank you.', 1),
('Peetha Ravi L-8, N130497', 'Sir, Your website is very slow,when you launch new website.', '10.2.32.83', 424, '2014-03-20', 'We will try to rectify this problem. \r\n\r\nThank you.', 1),
('HR', 'THERE IS A PROBLEM FROM ANOTHER CLASS STUDENTS  THAT IS THEY ALWAYS INSULT OUR CLASS BECAUSE WE ARE  COLLECTING LESS MONEY THAN THEM SO .CAN  YOU STOP   THE PICTORIAL REPRESENTATION OF  WEEKLY MONEY COLLECTION?', '10.2.38.14', 425, '2014-03-20', 'Please give your details like name , id and class while giving a FAQ.\r\nRegarding your problem, if you tell to batch representatives, they will take care of those classes who are insulting you. Regarding graphs, those for the sake information, if we give the money, it will create more problem. That is why we are giving graphs.\r\n\r\nThank you.', 1),
('NAGAMANI', 'SIR HELPING HANDS HOW TO HELP POOR PEOPLES AND POOR STUDENTS ????????????????', '10.2.33.18', 426, '2014-03-20', 'Please ask your representatives. If you are not satisfied, then bring it to our notice. We will take care. Anyway we are going to conduct a awareness camp on HH . In that, you will get clear idea about hh.\r\n\r\nThank you.', 1);
INSERT INTO `faqs` (`name`, `question`, `ip`, `sno`, `date`, `answer`, `status`) VALUES
('srinu', 'when you started health camp', '10.2.32.79', 427, '2014-03-20', 'It will be in between 1 to 5th of April(any two days).\r\n\r\nThank you.', 1),
