INSERT INTO `ufeedback` (`Name`, `Mail`, `Comment`, `Date`, `IP`) VALUES
('SYAMALADEVI', 'N130241', 'I think that the students those coming from poor family,don''t have money to bring any daily using things so, instead of giving money give them to the things which they want. and give little money for them. I think it is good because we don''t no how they were using that money. Even though they never miss use the money, but other students are not think like that. ', '2003-02-14', '10.2.26.55'),
('Nageswara rao.Kandik', 'N130946@rgukt.in', 'Respected sir,I''m from the class MU-5,sir,every tuesday we are collecting money from our class and hand overing that money to our cluster representative .But in your report of finance there is no amount of money is indicated within the column of our class,I was not able to understand what is happening and where the fault had going on ,so please consider my request and I''m hoping an action on this issue,Thanking you sir.', '2004-02-14', '10.2.41.9'),
('V.SEKHAR', 'lokeshchaitanya.583@gmail.com', 'Please, never mind about future........... if it necessary spent money only on one man.. I think that is more satisfaction than help many with mini money..', '2006-02-14', '10.3.3.212'),
('harikrishna', 'rguhelpinhands@gmail.com', 'it is very good idea', '2014-02-14', '10.2.29.36'),
('N130181', 'N130181@nuz.rgukt.in/', '', '2017-02-14', '10.2.25.39'),
