('N110983', 'rajargukt0@gmail.com', '', '2012-03-14', '10.3.33.56'),
('somarouthu varalaksh', 'varam.sweet@gmail.com', 'Gud evening sir! Here, I have a thought that why can''t we try to join the beggers (childs of 6yrs old to 15yrs old) either in government schools or in any ashramas which provide free education? Or else, why can''t we start a public school for those pupil by spending some of our helping hands money? of course it is a matter of money, management, recognition and all, we try to take classes for them which will give them some basic knowledge that everyone should have at that age to live & also to survive in this society! Also we try to give some help to them to do any bussiness,work or anything in which they have interested to settle somehow not as beggers not only by giving money help(We may also go for donors by publishing in newspapers or somehow! money won''t be a big problem since in our society many people are trying to help but they don''t have any medium to help! so, money problem is not considerable when we want this to do really!) it can also be done by giving some basic knowledge/ idea/ support(We may also ask help for many good retired teachers/ working teachers/faculty who want to take some general classes or any one..)that required to them. We (RGUIIIT students) are allways ready to do this work and also to take classes for them in any time!  If you people are have any interest in this, please give me your response! Thank You!', '2012-03-14', '10.3.31.30'),
